INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(70358, 0, 0, 'Padaren legends tell of Lei Shen, The Thunder King. He was the brutal founder of the Mogu empire over 12,000 years ago.', 12, 0, 100, 0, NULL, 35350, '1'),
(70358, 1, 0, 'He united the mogu, defeated the other pandaren races, and founded a glorious nation with the slave labor of those he conquered.', 12, 0, 100, 0, NULL, 35351, '2'),
(70358, 2, 0, 'The Pandaren are terrified that the former Emperor will try to reclaim his empire, and enslave them once again.', 12, 0, 100, 0, NULL, 35354, '3'),
(70358, 3, 0, 'But we have our own reasons for assisting them. I will allow Lo\'themar to explain.', 12, 0, 100, 0, NULL, 35355, '4'),
(70360, 0, 0, 'Over 12,000 years ago, the Mogu empire was founded by Lei Shen, \"The Thunder King\".', 12, 0, 100, 0, NULL, 35970, 'Isle of Thunder - INTRO 1'),
(70360, 1, 0, 'Legend has it that the Thunder King possessed enormous power, and built himself a palatial fortress. We should be able to see it soon...', 12, 0, 100, 0, NULL, 35972, 'Isle of Thunder - INTRO 2'),
(70360, 2, 0, 'There has been the worst year of my life: Theramore, destroyed. And a betrayal from within the Kirin-Tor.', 12, 0, 100, 0, NULL, 35519, 'Isle of Thunder - INTRO 3 (Jaina)'),
(70360, 3, 0, 'The lesson is clear. From here on out. I\'m taking the initiative.', 12, 0, 100, 0, NULL, 35520, 'Isle of Thunder - INTRO 4 (Jaina)'),
(70360, 4, 0, 'They seek to defeat the Thunder King, not to protect Pandaria, but to claim his power for themselves.', 12, 0, 100, 0, NULL, 35522, 'Isle of Thunder - INTRO 5 (Jaina)'),
(70360, 5, 0, 'But, this time we\'re a step ahead.', 12, 0, 100, 0, NULL, 35523, 'Isle of Thunder - INTRO 6 (Jaina)'),
(70360, 6, 0, 'This fight will take everything we have. I hope you are ready.', 12, 0, 100, 0, NULL, 35525, 'Isle of Thunder - INTRO 7 (Jaina)');
